import React from 'react';
import ReactDOM from 'react-dom';

import CssBaseline from '@material-ui/core/CssBaseline';

import {App} from './js/App';

ReactDOM.render(
    <React.StrictMode>
        <CssBaseline/>
        <App />
    </React.StrictMode>,
document.getElementById('root')
);

